import React, { useState } from 'react';
import Layout from './components/Layout';
import Home from './pages/Home';
import CollegeSearch from './pages/collegeSearch';
import About from './pages/about';

const App = () => {
  const [currentPage, setCurrentPage] = useState('home');

  const renderPage = () => {
    switch (currentPage) {
      case 'home':
        return <Home />;
      case 'collegeSearch':
        return <CollegeSearch />;
      case 'about':
        return <About />;
      default:
        return <Home />;
    }
  };

  return (
    <Layout>
      <nav className="bg-gray-800 text-white p-4">
        <ul className="flex justify-center space-x-4">
          <li>
            <button
              onClick={() => setCurrentPage('home')}
              className={`${
                currentPage === 'home' ? 'font-bold' : ''
              } hover:underline`}
            >
              Home
            </button>
          </li>
          <li>
            <button
              onClick={() => setCurrentPage('collegeSearch')}
              className={`${
                currentPage === 'collegeSearch' ? 'font-bold' : ''
              } hover:underline`}
            >
              College Search
            </button>
          </li>
          <li>
            <button
              onClick={() => setCurrentPage('about')}
              className={`${
                currentPage === 'about' ? 'font-bold' : ''
              } hover:underline`}
            >
              About
            </button>
          </li>
        </ul>
      </nav>

      <div className="p-4">{renderPage()}</div>
    </Layout>
  );
};

export default App;
